import { BootstrapNotifyBarService } from "@shared/services/bootstrap-notify.service";

@Component({
  selector: 'app-bandeja-roles',
  templateUrl: './bandeja-roles.component.html'
})
export class BandejaRolesComponent implements OnInit {

  isLoading = false;  
  columnas = ['menu', 'Codigo', 'Nombre','Descripcion', 'FechaRegistro', 'Estado'];
  listarDto: any[] = [];
  public aplicaciones: any[];
  

  constructor(
    public dialogo: MatDialog,
    private rolesService: RolesService,
    private router: Router,
    public dialog: MatDialog,
    private bootstrapNotifyBarService: BootstrapNotifyBarService
  ) {
  }
  ngOnInit() {
   this.listar();
  }
  listar(){
    this.rolesService.listarRoles().subscribe((data: any[]) => {
      this.listarDto = data;      
      this.isLoading = false;
    });
  }
  Eliminar(id:number){
    this.dialogo.open(DialogoConfirmacionComponent, {
      maxWidth: '25vw',
      maxHeight: 'auto',
      height: 'auto',
      width: '25%',
      disableClose: true,
      data: {
        titulo: `Mensaje de Confirmación`,
        mensaje: `¿Está seguro que desea eliminar?`
      }
    })
      .afterClosed()
      .subscribe(async (confirmado: Boolean) => {
        
        if (confirmado) {
          this.rolesService.eliminarRoles(id).subscribe((res:any) => {
            if(res.tipoResultado==1){
              this.bootstrapNotifyBarService.notifySuccess(res.mensaje);
              this.listar();
            }else{
              this.bootstrapNotifyBarService.notifyWarning(res.mensaje);
            }     
          });          
        }
      });
  }
  
  Buscar() {

  }
  Limpiar() {

  }
  onPaginateChange(event: PageEvent) {
    const pageIndex = event.pageIndex + 1;
    const pageSize = event.pageSize;
 }

}
